body:
This PR fixes incorrect binding of `this` for babel plugins. The `this` object is used to share state across the `pre`, `post` and `visitor`-handlers as can be seen in the following [example in the babel handbook](https://github.com/thejameskyle/babel-handbook/blob/master/translations/en/plugin-handbook.md#-pre-and-post-in-plugins):

```js
export default function({ types: t }) {
  return {
    pre(state) {
      this.cache = new Map();
    },
    visitor: {
      StringLiteral(path) {
        this.cache.set(path.node.value, 1);
      }
    },
    post(state) {
      console.log(this.cache);
    }
  };
}
```

This is done by adding a plugin object interface (a babel plugin is a function which must return this object) and by making `Visitor` generic.

